import React, { Component } from 'react'

export default class Startup extends React.Component {
    constructor(props) {
      super(props);
      this.state = {street: '', city: '', zipcode: ''};
  
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
    }
  
    handleChange(event) {
      this.setState({street: event.target.streetcity});
      this.setState({city: event.target.city});
      this.setState({zipcode: event.target.zipcode}); 
    }
  
    handleSubmit(event) {
      alert('A name was submitted: ' + this.state.street, this.state.city, this.state.zipcode);
      event.preventDefault();
    }
  
    render() {
      return (
        <form onSubmit={this.handleSubmit}>
          <label>
            Street:
            <input type="text" value={this.state.street} onChange={this.handleChange} />
          </label>
          <label>
            City:
            <input type="text" value={this.state.city} onChange={this.handleChange} />
          </label>
          <label>
            ZipCode:
            <input type="text" value={this.state.zipcode} onChange={this.handleChange} />
          </label>
          <input type="submit" value="Submit" />
        </form>
      );
    }
  }
